function Po(){
    /** 唯一标识 */
    this.id = null;
    /** 菜单名称 */
    this.name = null;
    /** 菜单在界面上显示的名称 */
    this.text = null;
    /** 菜单图标 */
    this.icon = null;
    /** 菜单对应的url */
    this.url = null;
    /** 属性 */
    this.attrs = null;
};

Po.tableName = "tt_menu_item"
module.exports = Po;